The '''C-Star class''' (sometimes written as '''C* class''') of [[non-rigid airship]]s or "blimps" were used by Britain's [[Royal Naval Air Service]] for convoy escort duties during World War I. Developed from the [[Coastal class airship|Coastal class]] (often referred to as the "C class"), the "*" in their designation indicated a modification of the original class <ref name="Janes 1919 11c">''Jane's'' 1919, 11c</ref> which they slowly replaced in service.
The C-Star class were slightly larger than their predecessors. With an endurance of up to 30 hours, and more powerful (and reliable) [[Renault]] engines, the C*s had the same basic layout as the Coastal Class, with the same trilobe envelope. However, the envelope tapered towards the rear, as on the [[SSZ class airship|SSZ class]], which greatly improved stability, as did the larger control surfaces.<ref>London, 1999, p.45</ref>
